  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a comprehensive
  research study of the Aleutian Islands salmon resources in 1982. The study encompassed
  the area west of Unimak Pass to Attu Island. Thirteen major islands and several
  minor land masses were investigated regarding anadromous stream potential. The field
  study was conducted to research the potential of the Aleutian Islands for commercial
  salmon fisheries. Basic studies on a prioritized basis included: species identification
  and enumeration; cataloging, photographing, and recording physical characteristics
  of salmon streams; definition of spawning areas; recording streams with a potential
  for rehabilitation and enhancement; examination of returning fish for high seas
  salmon tags; gathering length/weight and age data of salmon at one major stream
  on each island examined; and collection of tissue samples from pink salmon for stock
  separation studies.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
